$(document).ready( function () {
    $('#tablausuarios').DataTable({
        dom: 'Bfrtip',
        buttons: [
            {
                extend: 'excelHtml5',
                text: '<i class="fa-solid fa-file-excel"></i> Excel',
                className: 'btn btn-success',
                title: function(){
                    var currentDate = moment().format('DD-MM-YYYY');

                    return 'Usuarios del Sistema - ' + currentDate;
                },
                exportOptions: { //OPCIONES DE EXPORTACION
                    search: 'applied', //Para aceptar reporte de una busqueda
                    order: 'applied', //Para mantener el orden aplicado en la datatable
                },
            },
            {
                extend: 'pdfHtml5',
                text: '<i class="fa-solid fa-file-pdf"></i> PDF',
                className: 'btn btn-danger',
                title: function(){
                    var currentDate = moment().format('DD-MM-YYYY');

                    return 'Usuarios del Sistema - ' + currentDate;
                },
                pageSize: 'letter', //TAMAÑO DE LA HOJA, CARTA EN ESTE CASO
                exportOptions: { //OPCIONES DE EXPORTACION
                    search: 'applied', //Para aceptar reporte de una busqueda
                    order: 'applied', //Para mantener el orden aplicado en la datatable
                    stripNewlines: false, //Para mantener saltos de linea (ignorados en este caso)
                    columns: ':not(:last-child:nth-last-child(1))'
                },
                customize: function (doc) { //CONFIGURACION Y STYLES DE LA PLANTILLA

                    //doc es la variable con la que se manipula el documento
                    //Aca estamos obteniendo el numero de regitros totales y guardandolos en la variable rcout
                    var rcout = doc.content[doc.content.length - 1].table.body.length - 1; //ROWS TOTALES
                
                    //Aca usamos la funcion splice() del objeto doc para eliminar de su contenido el encabezado, esto se debe a que
                    // por defecto la exportacion pone de titulo en el pdf el mismo nombre del archivo, esta funcion es para eliminar
                    // dicho encabezado y solo dejar el indicado mas abajo
                    doc.content.splice(0, 1);
                
                    // Obteniendo la fecha actual para insertar la fecha de generacion de reporte{
                    var now = new Date();
                    var minutes = now.getMinutes();
                    if(minutes < 10){
                        //Si los minutos son inferiores a 10 se concatena el 0 a la izquierda
                        minutes = '0'+minutes;
                    }
                
                    //Armando la fecha y guardandola en la variable jsDate, esta sera usada para insertar la fecha actual en el pdf
                    var jsDate = now.getDate() + '/' + (now.getMonth() + 1) + '/' + now.getFullYear() + ' a las ' + now.getHours() + ':' + minutes;
                    doc.pageMargins = [30, 90, 30, 30]; //MARGENES GENERALES DE LA PAGINA
                    doc.defaultStyle.fontSize = 8; //FONTSIZE POR DEFAULT
                    doc.styles.tableHeader.fontSize = 9; //FONTSIZE POR DEFAULT DE LOS HEADERS
                
                    /* indica que las dos primeras filas de la tabla se considerarán como encabezados en el PDF exportado. Esto significa que estas filas
                        se destacarán visualmente, por ejemplo, con un estilo diferente o una fuente más grande,
                        para diferenciarlas del resto del contenido de la tabla.
                        Dicho encabezado hace referencia a la tabla establecida en la linea 165*/
                    doc.content[doc.content.length - 1].table.headerRows = 2; //
                
                    /*Usamos el elemento header de doc para asegurar que el contenido establecido aca se quede siempre arriba*/
                    doc['header'] = (function (page, pages) { //HEADER:
                        return {
                            /*Aca se crea una tabla invisible para trabajar el titulo y el logo en la misma linea al tratarlos como
                             datos de una misma fila pero de distintas columnas */
                            table: { //CREANDO TABLA PARA ENCABEZADO
                                widths: ['auto', 'auto'], //POSICION AUTO
                
                                /* Como esto es una tabla, hay que deshabilitar los headers para simular el encabezado */
                                headerRows: 0, //SIN HEADERS DE TABLA.
                                body: [ //CONTENIDO DE LA TABLA
                                    [//FILA 1
                                        { //1RA COLUMNA ES EL LOGO
                                            width: 100, //ANCHO
                                            height: 50, //ALTO
                                            alignment: 'center', //POSICION
                                            image: 'data:image/png;base64,',
                                            //La imagen debe ser en URI, usa un convertidor online para obtener el URI de una imagen
                                        },
                                        { //2DA COLUMNA ES EL TITULO
                                            text: 'Usuarios del Sistema', //Titulo personalizado
                                            alignment: 'center',
                                            fontSize: 14,
                                            bold: true,
                                            width: 'auto',
                                            marginleft: 0 //Para mantener el centrado lo mayor posible
                                        }
                                    ],
                                    [//FILA 2
                                        { //1RA COLUMNA CESES TOTALES
                                            text:
                                                [
                                                    //Imprimiendo la variable rcout declarada en la linea 134
                                                    { text: 'Usuarios Totales: ', bold: true }, rcout.toString() +'\n',
                                                    { text: 'Fecha de Generacion de Reporte: ', bold: true }, jsDate.toString() +'\n',
                                                ]
                                        },{} //CADA FILA PIDE MINIMO 2 COLUMNAS, ASI QUE PONEMOS ESTA VACIA
                                    ]
                                ]
                            },
                            /*Como esto es una tabla hay que deshabilitar los bordes para simular un encabezado limpio*/
                            layout: 'noBorders', //SIN BORDES
                            margin: [30, 20, 220]//Margenes de la tabla, 1ro es LEFT, 2do es UP, 3ro es RIGHT, 4to es DOWN
                        }
                    });
                
                    doc['footer'] = (function (page, pages) { //FOOTER:
                
                        /*Aca no hay que hacer lo del header ya que el elemento footer de doc siempre sera puesto al final de la hoja sin
                        importar que*/
                        return { // 1 SOLA FILA
                            columns: [ // COLUMNAS DE LA FILA
                                {// COL 1
                                    alignment: 'left',
                                    text: [
                                        //Imprimiendo la variable jsDate con la fecha actual declarada en la linea 150
                                        { text: 'Reporte generado el: ', bold: true }, jsDate.toString(),
                                    ]
                                },
                                {// COL 2
                                    alignment: 'right',
                                    text: [
                                        //Imprimiendo con el metodo page de doc para obtener la pagina actual y pages para el total de paginas
                                        { text: 'pagina ', bold: true }, page.toString(), { text: ' de ', bold: true },pages.toString(),
                                    ],
                                    margin: [0, 0, 25], //Margen para alinear el conteo de paginas
                                }
                            ],
                            margin: [30, 10, 10] //Margenes del Footer
                        }
                    });
                
                    //DEFINIENDO ESTILOS DEL CONTENIDO EXPORTADO EN EL REPORTE
                
                    /*Aca se definen los estilos de la tabla al ser exportada con objLayout*/
                    var objLayout = {};
                
                    //Ancho de las lineas
                    objLayout['hLineWidth'] = function (i) { return .8; };
                    objLayout['vLineWidth'] = function (i) { return .5; };
                
                    //Color de las lineas, en este caso sombra medio gris
                    objLayout['hLineColor'] = function (i) { return '#aaa'; };
                    objLayout['vLineColor'] = function (i) { return '#aaa'; };
                
                    //Padding de los registros de la tabla
                    objLayout['paddingLeft'] = function (i) { return 5; };
                    objLayout['paddingRight'] = function (i) { return 15; };
                
                    //Aplicando los estilos definidos en la variable objLayout
                    doc.content[doc.content.length - 1].layout = objLayout;
                
                }
            },
        ],
        responsive: true,
        language: {
            lengthMenu: "Mostrar _MENU_ registros por pagina",
            zeroRecords: "Ningun operador encontrado",
            info: "Mostrando de _START_ a _END_ de un total de _TOTAL_ registros",
            infoEmpty: "Ningun operador encontrado",
            infoFiltered: "(filtrados desde _MAX_ registros totales)",
            search: "Buscar: ",
            loadingRecords: "Cargando... ",
            paginate: {
                first: "Primero",
                last: "Ultimo", 
                next: "Siguiente",
                previous: "Anterior"
            }
        }
    })
    
    $("#desactivar").on("click", function (e) {
        e.preventDefault(); // Evita el comportamiento predeterminado del enlace.
    
        Swal.fire({
            title: "¿Estás seguro?",
            text: "Si decides desactivar esta cuenta de operador, el usuario no podra iniciar sesion hasta ser reactivado",
            icon: "warning",
            showCancelButton: true,
            confirmButtonColor: "#d33",
            cancelButtonColor: "#3085d6",
            confirmButtonText: "Sí, entiendo",
            cancelButtonText: "Cancelar",
        }).then((result) => {
            if (result.isConfirmed) {
                // Si se confirmó, redirige al enlace del botón.
                window.location.href = $(this).attr("href");
            }
        });
    });

    $("#reactivar").on("click", function (e) {
        e.preventDefault(); // Evita el comportamiento predeterminado del enlace.
    
        Swal.fire({
            title: "¿Estás seguro?",
            text: "Reactivar este operador lo volvera parte de los demas procesos del sistema ¿Estás seguro?",
            icon: "warning",
            showCancelButton: true,
            confirmButtonColor: "#3085d6",
            cancelButtonColor: "#d33",
            confirmButtonText: "Sí, seguro",
            cancelButtonText: "Cancelar",
        }).then((result) => {
            if (result.isConfirmed) {
                // Si se confirmó, redirige al enlace del botón.
                window.location.href = $(this).attr("href");
            }
        });
    });
    
    $("#editarpreguntasseguridad").on("click", function (e) {
        e.preventDefault(); // Evita el comportamiento predeterminado del enlace.
    
        Swal.fire({
            title: "¿Estás seguro?",
            text: "Si decides editar, tendras que volver a introducir todas las respuestas a las preguntas, y una vez echo no se podra volver",
            icon: "warning",
            showCancelButton: true,
            confirmButtonColor: "#d33",
            cancelButtonColor: "#3085d6",
            confirmButtonText: "Sí, entiendo",
            cancelButtonText: "Cancelar",
        }).then((result) => {
            if (result.isConfirmed) {
                // Si se confirmó, redirige al enlace del botón.
                window.location.href = $(this).attr("href");
            }
        });
    });
    
    
    $("#editarcredenciales").on("click", function (e) {
        e.preventDefault(); // Evita el comportamiento predeterminado del enlace.
    
        Swal.fire({
            title: "¿Estás seguro?",
            text: "Al editar las credenciales tendras que volver a iniciar sesion",
            icon: "warning",
            showCancelButton: true,
            confirmButtonColor: "#d33",
            cancelButtonColor: "#3085d6",
            confirmButtonText: "Sí, editar",
            cancelButtonText: "Cancelar",
        }).then((result) => {
            if (result.isConfirmed) {
                // Si se confirmó, redirige al enlace del botón.
                window.location.href = $(this).attr("href");
            }
        });
    });
} );